import React from 'react';
import Styled from 'styled-components';

const Text = (props) => {
	const Text = Styled.div`
        text="School in the Cloud"
        fontSize="30px"
        height="100%"
        letterSpacing="2px"
        color="#fff"
        fontFamily="gPro"
        lineHeight="60px"
        }`;

	return <Text>{props.text}</Text>;
};
export default Text;
